import s from "./Profile.module.css";
import ProfileInfo from "./Profileinfo/Profileinfo";

const Profile = (props) => {
  let posts = [
    { id: 1, message: "Hi, how are you", likesCount: 12 },
    { id: 2, message: "It's my first post", likesCount: 11 },
  ];

  return (
    <div>
      <ProfileInfo />
      <MyPosts posts={posts} />
    </div>
  );
};
export default Profile;
